import React, { Fragment } from "react";
import RegisterItem from "./RegisterItem";

function RegisterList(props) {
    console.log
  return (
    <Fragment>
      <ul>
        {props.list.map((value, index) => (
          <RegisterItem props={value} />
        ))}
      </ul>
    </Fragment>
  );
}

export default RegisterList;

